Hot in Cleveland - Season 4 - Episode 13 (WEBRip - MP4)
-------------------------------------------------------

In the season three finale, nothing could have prepared the ladies for the shocking
discovery of an abandoned baby at their doorstep. In the season four premiere, the
infant's surprising identity is revealed! Meanwhile, Elka schemes to regain the
upper hand with Pierre, Melanie is caught in a love triangle at her new job and
Victoria finally lands a major movie role. Will the ladies overcome the occupational
hazards and romantic obstacles created by recurring guest stars Eddie Cibrian,
Heather Locklear and Regis Philbin?

Produced by TV Land, Hazy Mills and SamJen Productions.

